import { useState } from "react";
import { useParams } from "react-router-dom";



function Movie() {
    const [movie, setMovie] = useState({})

    let { id } = useParams()

    useEffect(() => {
        let myMovie = {
            id: 1,
            title: "Heartbreakers",
            release_date: "2001-03-23",
            runetime: 120,
            mpaa_rating: "PG-13",
            description: "Movie about ewhoring"
        }
        setMovie = myMovie
    }, [id]);

    return (
        <>
            <div >
                <h2>Movie</h2>
                <hr></hr>
            </div>
        </>
      );
}

export default Movie;
